import React, { Component } from "react";
import API from "../utils/API";
import "./style.css";

class Saved extends Component {
    state = {
        books: []
    }

    // componentDidMount() {
    //     API.getBooks()
    //         .then(res => {
    //             this.setState({ books: res.data })
    //         })
    // }

    render() {
        return (
            <div>
                <div class="saved">
                    {this.state.books.map(book => (
                        <div class="book">
                            <div class="top">
                                <h3>{book.title}</h3>
                                <div class="button">
                                    <a>View</a>
                                    <a>Delete</a>
                                </div>
                            </div>
                            <p>Written By: {book.authors}</p>
                            <div class="body"> 
                                <img></img>
                            </div>
                        </div>
                    ))}
                </div>
            </div>
        )
    };
}

export default Saved;
